        "description": "There are five modules that provide quasiquoters each for different variant parses C99 GCC parses C99 plus GNU extensions CUDA parses C99 plus GNU and CUDA extensions OpenCL parses C99 plus GNU and OpenCL extensions and ObjC parses C99 plus subset of Objective-C For version of GHC prior to the quasiquoters generate Template Haskell expressions that use data constructors that must be in scope where the quasiquoted expression occurs You will be safe if you add the following imports to any module using the quasiquoters provided by this package import qualified Data.Loc import qualified Data.Symbol import qualified Language.C.Syntax These modules may also be imported unqualified of course The quasiquoters also use some constructors defined in the standard Prelude so if it is not imported by default it must be imported qualified On GHC and above you can use the quasiquoters without worrying about what names are in scope The following quasiquoters are defined cdecl Declaration of type InitGroup cedecl External declarations top-level declarations in file including function definitions and declarations of type Definition cenum Component of an enum definition of type CEnum cexp Expression of type Exp cstm Statement of type Stm cstms list of statements of type Stm citem Block item of type BlockItem block item is either declaration or statement cfun Function definition of type Func cinit Initializer of type Initializer cparam Declaration of function parameter of type Param cparams Declaration of function parameters of type Param csdecl Declaration of struct member of type FieldGroup cty type of type Type cunit compilation unit of type Definition Antiquotations allow splicing in subterms during quotation These subterms may bound to Haskell variable or may be the value of Haskell expression Antiquotations appear in quasiquotation in the form ANTI VARID where ANTI is valid antiquote specifier and VARID is Haskell variable identifier or in the form ANTI EXP where EXP is Haskell expressions the parentheses must appear in this case The Haskell expression may itself contain quasiquote but in that case the final must be escaped as Additionally VARID is shorthand for exp VARID and EXP is shorthand for exp EXP i.e exp is the default antiquote specifier It is often useful to use typedefs that aren in scope when quasiquoting e.g cdecl uint32 foo The quasiquoter will complain when it sees this because it thinks uint32 is an identifier The solution is to use the typename keyword borrowed from to tell the parser that the identifier is actually type name That is we can write cdecl typename uint32 foo to get the desired behavior Valid antiquote specifiers are id identifier The argument must be an instance of ToIdent const constant The argument must be an instance of ToConst int An integer constant The argument must be an instance of Integral uint An unsigned integer constant The argument must be an instance of Integral lint long integer constant The argument must be an instance of Integral ulint An unsigned long integer constant The argument must be an instance of Integral llint long long integer constant The argument must be an instance of Integral ullint An unsigned long long integer constant The argument must be an instance of Integral float float constant The argument must be an instance of Fractional double double constant The argument must be an instance of Fractional long double long double constant The argument must be an instance of Fractional char char constant The argument must have type Char string string char constant The argument must have type String exp expression The argument must be an instance of ToExp func function definition The argument must have type Func args list of function arguments The argument must have type Exp decl declaration The argument must have type InitGroup decls list of declarations The argument must have type InitGroup sdecl struct member declaration The argument must have type FieldGroup sdecls list of struct member declarations The argument must have type FieldGroup enum An enum member The argument must have type CEnum enums An list of enum members The argument must have type CEnum esc An arbitrary top-level definition such as an include or define The argument must have type String edecl An external definition The argument must have type Definition edecls An list of external definitions The argument must have type Definition item statement block item The argument must have type BlockItem items list of statement block item The argument must have type BlockItem stm statement The argument must have type Stm stms list statements The argument must have type Stm ty type The argument must have type Type spec declaration specifier The argument must have type DeclSpec param function parameter The argument must have type Param params list of function parameters The argument must have type Param pragma pragma statement The argument must have type String init An initializer The argument must have type Initializer inits list of initializers The argument must have type Initializer",
